"     </li>",
"     <li>",
"      Pipraks (AE, BH, CY, EG, IQ, IR, JO, KW, LB, LY, OM, QA, SA, SY, YE);",
"     </li>",
"     <li>",
"      Pipril (AT, AU, BG, CH, CZ, DE, ES, FI, GB, GR, HN, HR, HU, IE, PK, PL);",
"     </li>",
"     <li>",
"      Pipril &rdquo;Orifarm&rdquo; (DK);",
"     </li>",
