var title_f34_13_35037="Mechanisms of glucocorticoid insensitivity in severe asthma";
var content_f34_13_35037=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F88276&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F88276&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Mechanisms implicated in glucocorticoid insensitivity in severe asthma",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 390px; height: 224px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A number of factors including infection, oxidative stress (either directly or indirectly from cigarette smoking), allergen exposure (leading to Th2 cytokine expression), inflammation (eg, IL-17 production from Th17 and other cells), and a lack of vitamin D3 can modulate glucocorticoid function and have been shown to be important in patients with glucocorticoid resistant asthma. Drugs that target these abnormal processes or signalling pathways may prove of benefit in severe asthma.",
"    <div class=\"footnotes\">",
"     IL: interleukin; LPS: lipopolysaccharide; ROS: reactive oxygen species; TH17: IL-17-producing T helper lymphocytes.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
